import React from 'react'
import './../../Style/events/NextEvent.css'
import './../../Style/blogs/BlogThumbnail.css'
import { useNavigate } from 'react-router-dom';
function NextEvent({url, image,id,eventimageone,eventimagetwo,eventtitle,iventdate}) {
  const navigate = useNavigate();
  return (
    <>
        <div className='eventPoster'>
            <a href={url} target="_blank">
              <img src={image} alt="Description of the image"></img>
            </a>
            <div 
                className='thumbnailLinks' 
                onClick={() => {
                  navigate(`/event/:url, image,id,eventimageone,eventimagetwo,eventtitle,eventdate`);
                              }
                        }
                        >
                            <a target="_blank">Read More</a>
                        </div>
        </div>
    </>
  )
}

export default NextEvent
